import React from 'react';
import './App.css';
import {Route}from 'react-router-dom';

import HomePage from './pages/homepage/homepage.compoent';

const HatsPage =()=><div>Hatpages</div>

function App() {
  return (
    <div>   
    <Route to='/hats' component={HatsPage}/>
    <HomePage/>
    </div>

  );
}

export default App;
